Over the past 3 weeks, Hunterdon Medical Center has increased its bed capacity from 178 to 366 beds – a 93% increase.

@HMHNewJersey & its hospitals have more than tripled negative pressure beds from 278 to 869.

@HackensackUMC has increased critical care capacity from 49 to 191.

